import React from 'react';

const Navigation = () => (
    <ul>
        <li><Link to="/">Links</Link></li>
        <li><Link to="/Articles">Articles</Link></li>
        <li><Link to="/Notes">Notes</Link></li>
    </ul>
);

export default Navigation;
